import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import UserManagement from './pages/UserManagement';
import SystemMonitoring from './pages/SystemMonitoring';
import ReportGeneration from './pages/ReportGeneration';
import Settings from './pages/Settings';
import IssueResolution from './pages/IssueResolution';
import Logout from './pages/Logout';

function App() {
  return (
    <Router>
      <div className="dashboard-container">
        {/* Sidebar */}
        <nav className="dashboard-sidebar">
          <ul>
            <li><Link to="/">Dashboard</Link></li>
            <li><Link to="/user-management">User Management</Link></li>
            <li><Link to="/system-monitoring">System Monitoring</Link></li>
            <li><Link to="/report-generation">Report Generation</Link></li>
            <li><Link to="/settings">Settings</Link></li>
            <li><Link to="/issue-resolution">Issue Resolution</Link></li>
            <li><Link to="/logout">Logout</Link></li>
          </ul>
        </nav>

        {/* Main Content */}
        <main className="dashboard-content">
          <Routes>
            <Route path="/" element={<h2>Welcome to the Admin Dashboard</h2>} />
            <Route path="/user-management" element={<UserManagement />} />
            <Route path="/system-monitoring" element={<SystemMonitoring />} />
            <Route path="/report-generation" element={<ReportGeneration />} />
            <Route path="/settings" element={<Settings />} />
            <Route path="/issue-resolution" element={<IssueResolution />} />
            <Route path="/logout" element={<Logout />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
